import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import PostJobsComponent from "./components/PostJobComponent";
import FindJobsComponent from "./components/FindJobsComponent";

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route exact path="/" component={PostJobsComponent} />
          <Route path="/find-jobs" component={FindJobsComponent} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
